import axios from 'axios'

const GetPvz = (props) => {
    const[pvz, setPvz] = React.useState([])

    async function getPvz(id){
        const getPVZ = await axios.get(`http://127.0.0.1:3001/pvz/${id}`)
        setPvz(getPVZ.data.date)
    }
    
    
    
    console.log(props.pvz)
    return ( 
    <div>
        Получить ПВЗ
        <button>Пвз 1</button>
        <button>Пвз 2</button>
        <button>Пвз 3</button>
        <button>Пвз 4</button>
        <button>Пвз 5</button>
        <button>Пвз 6</button>
        <button>Пвз 7</button>
        <button>Пвз 8</button>
        {/* {pvz.address} */}
    </div> );
}
 
export default GetPvz;
